        // \"autoApply\" :true,\n          showCustomRangeLabel:true,\n          autoUpdateInput:true,\n          alwaysShowCalendars :false,\n          singleDatePicker:false,\n          applyClass:'btn-danger',\n          minDate:'',\n          maxDate:''\n        };\n        \n        $('#config-demo').daterangepicker(options, function(start:any, end:any, label:any) { \n          console.log('New date range selected: ' + start.format('YYYY-MM-DD') + ' to ' + end.format('YYYY-MM-DD') + ' (predefined range: ' + label + ')'); \n          that.dateControl.setValue(start.format('YYYY-MM-DD HH:mm:ss') +\" \"+end.format('YYYY-MM-DD HH:mm:ss'));\n        });;\n        \n      }\n    });\n  }\n\n}\n\n    \n\n    \n        \n\n    \n\n    \n                \n                    ./datepicker.component.scss\n                \n                \n    \n\n    \n        \n        \n            \n                Legend\n            \n            \n                Html element\n            \n            \n                Component\n            \n            \n                Html element with directive\n            \n        \n    \n\n    \n\n\n\n\n\n\n        var COMPONENT_TEMPLATE = ''\n    var COMPONENTS = [{'name': 'AppComponent', 'selector': 'app-root'},{'name': 'CoreComponent', 'selector': 'app-core'},{'name': 'DashboardComponent', 'selector': 'app-dashboard'},{'name': 'DataTableComponent', 'selector': 'app-data-table'},{'name': 'DatepickerComponent', 'selector': 'app-datepicker'},{'name': 'HomeComponent', 'selector': 'app-home'},{'name': 'UserComponent', 'selector': 'app-user'}];\n    var DIRECTIVES = [{'name': 'DatePickerDirective', 'selector': '[appDatePicker]'}];\n    var ACTUAL_COMPONENT = {'name': 'DatepickerComponent'};\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"pipes/EngToNepNumberPipe.html":{"url":"pipes/EngToNepNumberPipe.html","title":"pipe - E